$_MODULE['<{wkwebp}prestashop>adminwebpconfigurationcontroller_542909814437e2808cf574eeb407f318'] = 'Изберете диапазона от близо без загуби от 0 (най-много предварителна обработка) до 100 (без предварителна обработка)';
